export default function MensagemMeta({metaZap, zaps}) {
    console.log(metaZap, zaps)
    switch (zaps) {
        case zaps >= metaZap:
            return (
            <div className="mensagem-final">
                <h2>Mandou bem!</h2>
                <h3>Você atingiu sua meta de Zaps!</h3>
            </div>
            )
        default: 
            return (
                <div className="mensagem-final">
                    <h2>Ah,</h2>
                    <h3>Mas ainda não atingiu seu objetivo de Zaps...</h3>
                </div>
            )
    }
}
